import React, {
    Component
} from 'react';

class StatefulGreeting extends Component {

    constructor(props) {
        super(props);
        this.state = {
            introduction: 'Hello!'
        };
    }
    render() {
        return <
            h1 > Hello, {
                this.props.name
            }, {
                this.props.greeting
            } < /h1>
    }

}

export default StatefulGreeting
